import Vue from "vue";
import Router from "vue-router";

import Home from "@/views/Home.vue";
import Login from "@/views/users/login.vue";

import prestataireHome from "@/views/prestataires/prestataireHome.vue";
import prestataireManeges from "@/views/prestataires/prestataireManeges.vue";
import prestataireManegeAdd from "@/views/prestataires/prestataireManegeAdd.vue";
import prestataireManegeUpdate from "@/views/prestataires/prestataireManegeUpdate.vue";

Vue.use(Router);

export default new Router({
    mode: "history",
    base: process.env.BASE_URL,
    routes:[
        {
            path: "/",
            name: "Home",
            component: Home
        },
        {
            path:"/login",
            name:"Login",
            component: Login
        },
        {
            path: "/prestataire",
            name: "prestataireHome",
            component: prestataireHome
        },
        {
            path: "/prestataire/maneges",
            name: "prestataireManeges",
            component: prestataireManeges
        },
        {
            path: "/prestataire/maneges/add",
            name: "prestataireManegeAdd",
            component: prestataireManegeAdd
        },
        {
            path: "/prestataire/maneges/:id",
            name: "prestataireManegeUpdate",
            component: prestataireManegeUpdate
        }
    ]
})
